import React from 'react';
import { Reimbursement } from '../models/Reimbursement';
import { Allreimbursements } from '../api/LibraryClient';
// import { QuickTable } from './QuickTable';

interface IBooksDisplayState {
  members: Reimbursement[];
  isError: boolean;
  errorMessage: string;
}

export class getAllreimbursements extends React.Component<any, IBooksDisplayState> {

  constructor(props: any) {
    super(props);
    this.state = {
      members: [],
      isError: false,
      errorMessage: '',
    }
  }

  async componentDidMount() {
    try {
      this.setState({
        members: await Allreimbursements()
      })
    } catch (e) {
      // We set the error information in our state.
      // This will let us render something about the error to the end user
      this.setState({

        isError: true,
        errorMessage: e.message,
      })
    }
  }



  clearError = () => {
    this.setState({
      isError: false,
      errorMessage: '',
    });
  }

  render() {

    if(!this.state.isError) {
      //map to a string so quicktable can render this.

      return this.state.members.map((u:Reimbursement)=>{
     return(
          <div key={u.reimbursementId} className="col">
          <span>userid:  {u.reimbursementId}</span>  
          <span>username:  {u.author}</span>  
          <span>password:  {u.amount}</span>  
          <span>firstname: {u.dateSubmitted}</span>  
          <span>lastname: {u.dateResolved}</span>  
          <span>email: {u.description}</span>  
          <span>role: {u.resolver}</span>  
          <span>role: {u.status}</span>  
          <span>role: {u.type}</span>  
          </div>
         )      
         })
    } 
else {

return  <h3>Finance manager role is required!</h3>

    }

  }

}
